import React, { useState } from "react";
import { Link } from "react-router-dom";
import styled, { keyframes } from "styled-components";

const animation1 = keyframes`
    0% {
        transform: translateX(0%);
    }
    50% {
        transform: translateX(-100%);
    }
    50.1% {
        transform: translateX(100%);
    }
    100% {
        transform: translateX(0%);
    }
`;

const animation2 = keyframes`
     0% {
        transform: translateX(0%);
    }
    100% {
        transform: translateX(-200%);
    }
`;

const Wrapper = styled.div`
  position: relative;
  width: 100%;
  height: 2rem;
  margin-top: 0.5rem;
  font-size: large.875rem;
  letter-spacing: -1px;
  padding: 0.25rem 1rem;
  box-sizing: border-box;
  background-color: #fff;
`;

const RbContainer = styled.div`
  overflow: hidden;
`;

const RbUl = styled.ul`
  display: flex;
  flex-wrap: nowrap;
`;

const Rolling = styled.div`
  display: flex;
  align-items: center;
  flex-wrap: nowrap;
  position: relative;
  border-top: 1px solid #bbb;
  border-bottom: 1px solid #bbb;
  padding: 40px 0;

  &::before {
    content: "";
    display: block;
    width: 100%;
    height: 1px;
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    background-color: #bbb;
    z-index: 1;
  }
`;

const RollingOriginal = styled.div`
  display: flex;
  align-items: center;
  flex-wrap: nowrap;
  position: relative;
  border-top: 1px solid #bbb;
  border-bottom: 1px solid #bbb;
  padding: 40px 0;
  animation: 10s linear infinite normal none running ${animation1};

  &::before {
    content: "";
    display: block;
    width: 100%;
    height: 1px;
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    background-color: #bbb;
    z-index: 1;
  }
`;

const RollingClone = styled.div`
  display: flex;
  align-items: center;
  flex-wrap: nowrap;
  position: relative;
  border-top: 1px solid #bbb;
  border-bottom: 1px solid #bbb;
  padding: 40px 0;
  animation: 10s linear infinite ${animation2};

  &::before {
    content: "";
    display: block;
    width: 100%;
    height: 1px;
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    background-color: #bbb;
    z-index: 1;
  }
`;

const RollingStop = styled.div`
  display: flex;
  align-items: center;
  flex-wrap: nowrap;
  position: relative;
  border-top: 1px solid #bbb;
  border-bottom: 1px solid #bbb;
  padding: 40px 0;
  animation-play-state: paused;

  &::before {
    content: "";
    display: block;
    width: 100%;
    height: 1px;
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    background-color: #bbb;
    z-index: 1;
  }
`;

const RbLi = styled.li`
  margin: 0 80px;
  cursor: pointer;
  z-index: 2;
  transition: 0.3s;
  transform: scale(1);
  &:hover {
    transform: scale(0.98);
    &::after {
      content: "";
      position: absolute;
      top: 0;
      left: 0;
      bottom: 0;
      right: 0;
      width: 100%;
      height: 100%;
      background-color: rgba(0, 0, 0, 0.2);
    }
  }
  &.big {
    width: 280px;
    height: 280px;
  }
  &.small {
    width: 200px;
    height: 200px;
  }

  .item {
    width: 100%;
    height: 100%;
  }
`;

const RbLiPrev = styled.li`
  top: 36px;
  transition: top 0.5s ease;
`;

const RbLiCurrent = styled.li`
  top: 0;
  transition: top 0.5s ease;
`;

const RbLiNext = styled.li`
  top: -36px;
`;

const RbLink = styled(Link)`
  display: flex;
  gap: 0.25rem;
  align-items: center;
  text-decoration: none;
  -webkit-line-clamp: 1;
  -webkit-box-orient: vertical;
  overflow: hidden;
  color: #000;
`;

interface Props {
  title: string;
}

const RollingBannerComponent = (props: Props) => {
  const [animate, setAnimate] = useState(true);
  const onStop = () => setAnimate(false);
  const onRun = () => setAnimate(true);

  return (
    <Wrapper>
      <RbContainer>
        <RbUl onMouseEnter={onStop} onMouseLeave={onRun}>
          <Rolling></Rolling>

          <RbLiCurrent>
            <RbLink to={""}>
              <div>12분전</div>
              <div>신성델타테크는 별로네</div>
              <div>test</div>
            </RbLink>
          </RbLiCurrent>
          <RbLiNext>
            <RbLink to={""}>
              <div>1일전</div>
              <div>포스코스 가즈아!!</div>
              <div>test2</div>
            </RbLink>
          </RbLiNext>
          <RbLi>
            <RbLink to={""}>
              <div>2일전</div>
              <div>아 짜증나네</div>
              <div>test3</div>
            </RbLink>
          </RbLi>
          <RbLiPrev>
            <RbLink to={""}>
              <div>2일전</div>
              <div>완전 나락이네</div>
              <div>test4</div>
            </RbLink>
          </RbLiPrev>
        </RbUl>
      </RbContainer>
    </Wrapper>
  );
};

export default RollingBannerComponent;
